import logo from './logo.svg';
import './App.css';
import Topnav from './Components/Topnav';
import Banner from './Components/Banner';
import Centerbanner from './Components/Centerbanner';
import { Card } from 'react-bootstrap';

import ScrollableCardList from '../src/Components/ScrollableCardList';

const cards = [
  { imageSrc: 'image1.jpg', title: 'Card 1' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  { imageSrc: 'image2.jpg', title: 'Card 2' },
  // ... more cards
];

function App() {
  return (
<>


<Topnav/>
<Banner/>
<Centerbanner/>

<Card/>

<ScrollableCardList cards={cards} />

</>
  );
}

export default App;
